//  found   : [A]frameless.TypedColumn[repl.MdocSession.App0.Foo,A]
//  required: frameless.TypedAggregate[repl.MdocSession.App0.Foo,?]
// fds.agg(fsum(fds('i)), fds('i)).show().run()
//                        ^^^^^^^

