Dealing with CSV files with multiple columns
When the dataset has many columns, it is impractical to define a case class that contains many columns we don't need. 
In such case, we can project the columns we do need, cast them to the proper type, and then call createUnsafe using a case class
that contains a much smaller subset of the columns.  
import org.apache.spark.sql.types.DoubleType
final case class IrisLight(kind: String, sLength: Double)

val testDataDf = spark.read.format("csv").load(testDataPath)
// testDataDf: org.apache.spark.sql.package.DataFrame = [_c0: string, _c1: string ... 3 more fields]
val projectedDf = testDataDf.select(testDataDf("_c4").as("kind"), testDataDf("_c1").cast(DoubleType).as("sLength"))
// projectedDf: org.apache.spark.sql.package.DataFrame = [kind: string, sLength: double]
val data = TypedDataset.createUnsafe[IrisLight](projectedDf)
// data: TypedDataset[IrisLight] = [kind: string, sLength: double]
data.take(2).run()
// res5: Seq[IrisLight] = WrappedArray(
//   IrisLight("Iris-setosa", 3.5),
//   IrisLight("Iris-setosa", 3.0)
// )

Working with Parquet
Spark is much better at reading the schema from parquet files. 
val testDataParquet = spark.read.format("parquet").load(testDataPathParquet)
// testDataParquet: org.apache.spark.sql.package.DataFrame = [sLength: double, sWidth: double ... 3 more fields]
testDataParquet.printSchema
// root
//  |-- sLength: double (nullable = true)
//  |-- sWidth: double (nullable = true)
//  |-- pLength: double (nullable = true)
//  |-- pWidth: double (nullable = true)
//  |-- kind: string (nullable = true)
//

So as long as we use a type (case class) that reflects the same number, type, and order of the fields 
from the data everything works as expected. 
val data: TypedDataset[Iris] = TypedDataset.createUnsafe[Iris](testDataParquet)
// data: TypedDataset[Iris] = [sLength: double, sWidth: double ... 3 more fields]
data.take(2).run()
// res10: Seq[Iris] = WrappedArray(
//   Iris(5.1, 3.5, 1.4, 0.2, "Iris-setosa"),
//   Iris(4.9, 3.0, 1.4, 0.2, "Iris-setosa")
// )

Dealing with Parquet files with multiple columns
The main difference compared to CSV is that with Parquet Spark is better at inferring the types. This makes it simpler 
to project the columns we need without having the cast the to the proper type. 
final case class IrisLight(kind: String, sLength: Double)

val projectedDf = testDataParquet.select("kind", "sLength")
// projectedDf: org.apache.spark.sql.package.DataFrame = [kind: string, sLength: double]
val data = TypedDataset.createUnsafe[IrisLight](projectedDf)
// data: TypedDataset[IrisLight] = [kind: string, sLength: double]
data.take(2).run()
// res11: Seq[IrisLight] = WrappedArray(
//   IrisLight("Iris-setosa", 5.1),
//   IrisLight("Iris-setosa", 4.9)
// )

TypedEncoder.html.body:
Typed Encoders in Frameless
Spark uses Reflection to derive its Encoders, which is why they can fail at run time. For example, because Spark does not support java.util.Date, the following leads to an error:
import org.apache.spark.sql.Dataset
import spark.implicits._

case class DateRange(s: java.util.Date, e: java.util.Date)

val ds: Dataset[DateRange] = Seq(DateRange(new java.util.Date, new java.util.Date)).toDS()
// java.lang.UnsupportedOperationException: No Encoder found for java.util.Date
// - field (class: "java.util.Date", name: "s")
// - root class: "repl.MdocSession.App0.DateRange"
//     at org.apache.spark.sql.catalyst.ScalaReflection$.$anonfun$serializerFor$1(ScalaReflection.scala:591)
//     at scala.reflect.internal.tpe.TypeConstraints$UndoLog.undo(TypeConstraints.scala:73)
//     at org.apache.spark.sql.catalyst.ScalaReflection.cleanUpReflectionObjects(ScalaReflection.scala:904)
//     at org.apache.spark.sql.catalyst.ScalaReflection.cleanUpReflectionObjects$(ScalaReflection.scala:903)
//     at org.apache.spark.sql.catalyst.ScalaReflection$.cleanUpReflectionObjects(ScalaReflection.scala:49)
//     at org.apache.spark.sql.catalyst.ScalaReflection$.serializerFor(ScalaReflection.scala:432)
//     at org.apache.spark.sql.catalyst.ScalaReflection$.$anonfun$serializerFor$6(ScalaReflection.scala:577)
//     at scala.collection.immutable.List.map(List.scala:293)
//     at org.apache.spark.sql.catalyst.ScalaReflection$.$anonfun$serializerFor$1(ScalaReflection.scala:562)
//     at scala.reflect.internal.tpe.TypeConstraints$UndoLog.undo(TypeConstraints.scala:73)
//     at org.apache.spark.sql.catalyst.ScalaReflection.cleanUpReflectionObjects(ScalaReflection.scala:904)
//     at org.apache.spark.sql.catalyst.ScalaReflection.cleanUpReflectionObjects$(ScalaReflection.scala:903)
//     at org.apache.spark.sql.catalyst.ScalaReflection$.cleanUpReflectionObjects(ScalaReflection.scala:49)
//     at org.apache.spark.sql.catalyst.ScalaReflection$.serializerFor(ScalaReflection.scala:432)
//     at org.apache.spark.sql.catalyst.ScalaReflection$.$anonfun$serializerForType$1(ScalaReflection.scala:421)
//     at scala.reflect.internal.tpe.TypeConstraints$UndoLog.undo(TypeConstraints.scala:73)
//     at org.apache.spark.sql.catalyst.ScalaReflection.cleanUpReflectionObjects(ScalaReflection.scala:904)
//     at org.apache.spark.sql.catalyst.ScalaReflection.cleanUpReflectionObjects$(ScalaReflection.scala:903)
//     at org.apache.spark.sql.catalyst.ScalaReflection$.cleanUpReflectionObjects(ScalaReflection.scala:49)
//     at org.apache.spark.sql.catalyst.ScalaReflection$.serializerForType(ScalaReflection.scala:413)
//     at org.apache.spark.sql.catalyst.encoders.ExpressionEncoder$.apply(ExpressionEncoder.scala:55)
//     at org.apache.spark.sql.Encoders$.product(Encoders.scala:285)
//     at org.apache.spark.sql.LowPrioritySQLImplicits.newProductEncoder(SQLImplicits.scala:251)
//     at org.apache.spark.sql.LowPrioritySQLImplicits.newProductEncoder$(SQLImplicits.scala:251)
//     at org.apache.spark.sql.SQLImplicits.newProductEncoder(SQLImplicits.scala:32)
//     at repl.MdocSession$App0$$anonfun$4.apply$mcV$sp(TypedEncoder.md:45)
//     at repl.MdocSession$App0$$anonfun$4.apply(TypedEncoder.md:44)
//     at repl.MdocSession$App0$$anonfun$4.apply(TypedEncoder.md:44)

As shown by the stack trace, this runtime error goes through ScalaReflection to try to derive an Encoder for Dataset schema. Beside the annoyance of not detecting this error at compile time, a more important limitation of the reflection-based approach is its inability to be extended for custom types. See this Stack Overflow question for a summary of the current situation (as of 2.0) in vanilla Spark: How to store custom objects in a Dataset?.
Frameless introduces a new type class called TypeEncoder to solve these issues. TypeEncoders are passed around as implicit parameters to every Frameless method to ensure that the data being manipulated is Encoder. It uses a standard implicit resolution coupled with shapeless' type class derivation mechanism to ensure every that compiling code manipulates encodable data. For example, the java.util.Date example won't compile with Frameless:
import frameless.TypedDataset
import frameless.syntax._

val ds: TypedDataset[DateRange] = TypedDataset.create(Seq(DateRange(new java.util.Date, new java.util.Date)))
// error: ds is already defined as value ds
// val ds: TypedDataset[DateRange] = TypedDataset.create(Seq(DateRange(new java.util.Date, new java.util.Date)))
//     ^^
// error: could not find implicit value for parameter encoder: frameless.TypedEncoder[repl.MdocSession.App0.DateRange]
// val ds: TypedDataset[DateRange] = TypedDataset.create(Seq(DateRange(new java.util.Date, new java.util.Date)))
//                                                      ^

Type class derivation takes care of recursively constructing (and proving the existence of) TypeEncoders for case classes. The following works as expected:
case class Bar(d: Double, s: String)
case class Foo(i: Int, b: Bar)
val ds: TypedDataset[Foo] = TypedDataset.create(Seq(Foo(1, Bar(1.1, "s"))))
// ds: TypedDataset[Foo] = [i: int, b: struct]
ds.collect()
// res3: frameless.Job[Seq[Foo]] = frameless.Job$$anon$4@2895c183

But any non-encodable in the case class hierarchy will be detected at compile time:
case class BarDate(d: Double, s: String, t: java.util.Date)
case class FooDate(i: Int, b: BarDate)

val ds: TypedDataset[FooDate] = TypedDataset.create(Seq(FooDate(1, BarDate(1.1, "s", new java.util.Date))))
// error: ds is already defined as value ds
// val ds: TypedDataset[Foo] = TypedDataset.create(Seq(Foo(1, Bar(1.1, "s"))))
//     ^^
// error: ds is already defined as value ds
// val ds: TypedDataset[FooDate] = TypedDataset.create(Seq(FooDate(1, BarDate(1.1, "s", new java.util.Date))))
//     ^^
// error: could not find implicit value for parameter encoder: frameless.TypedEncoder[repl.MdocSession.App0.FooDate]
// val ds: TypedDataset[FooDate] = TypedDataset.create(Seq(FooDate(1, BarDate(1.1, "s", new java.util.Date))))
//                                                    ^

It should be noted that once derived, reflection-based Encoders and implicitly derived TypeEncoders have identical performance. The derivation mechanism is different, but the objects generated to encode and decode JVM objects in Spark's internal representation behave the same at runtime.

Injection.html.body:
Injection: Creating Custom Encoders
Injection lets us define encoders for types that do not have one by injecting A into an encodable type B.
This is the definition of the injection typeclass:
trait Injection[A, B] extends Serializable {
  def apply(a: A): B
  def invert(b: B): A
}

Example
Let's define a simple case class:
case class Person(age: Int, birthday: java.util.Date)
val people = Seq(Person(42, new java.util.Date))
// people: Seq[Person] = List(Person(42, Mon Jun 14 18:28:35 UTC 2021))

And an instance of a TypedDataset:
val personDS = TypedDataset.create(people)
// error: could not find implicit value for parameter encoder: frameless.TypedEncoder[repl.MdocSession.App0.Person]
// val personDS = TypedDataset.create(people)
//                ^^^^^^^^^^^^^^^^^^^^^^^^^^^

Looks like we can't, a TypedEncoder instance of Person is not available, or more precisely for java.util.Date.
But we can define a injection from java.util.Date to an encodable type, like Long:
import frameless._
implicit val dateToLongInjection = new Injection[java.util.Date, Long] {
  def apply(d: java.util.Date): Long = d.getTime()
  def invert(l: Long): java.util.Date = new java.util.Date(l)
}
// dateToLongInjection: AnyRef with Injection[java.util.Date, Long] = repl.MdocSession$App0$$anon$1@679a9c47

We can be less verbose using the Injection.apply function:
import frameless._
implicit val dateToLongInjection = Injection((_: java.util.Date).getTime(), new java.util.Date((_: Long)))
// dateToLongInjection: Injection[java.util.Date, Long] = frameless.Injection$$anon$1@2564f6d3

Now we can create our TypedDataset:
val personDS = TypedDataset.create(people)
// personDS: TypedDataset[Person] = [age: int, birthday: bigint]

Another example
Let's define a sealed family:
sealed trait Gender
case object Male extends Gender
case object Female extends Gender
case object Other extends Gender

And a simple case class:
case class Person(age: Int, gender: Gender)
val people = Seq(Person(42, Male))
// people: Seq[Person] = List(Person(42, Male))

Again if we try to create a TypedDataset, we get a compilation error.
val personDS = TypedDataset.create(people)
// error: could not find implicit value for parameter encoder: frameless.TypedEncoder[repl.MdocSession.App1.Person]
// val personDS = TypedDataset.create(people)
//                ^^^^^^^^^^^^^^^^^^^^^^^^^^^

Let's define an injection instance for Gender:
import frameless._
implicit val genderToInt: Injection[Gender, Int] = Injection(
  {
    case Male   => 1
    case Female => 2
    case Other  => 3
  },
  {
    case 1 => Male
    case 2 => Female
    case 3 => Other
  })
// genderToInt: Injection[Gender, Int] = frameless.Injection$$anon$1@4db4f709

And now we can create our TypedDataset:
val personDS = TypedDataset.create(people)
// personDS: TypedDataset[Person] = [age: int, gender: int]

Alternatively, an injection instance can be derived for sealed families such as Gender using the following 
import, import frameless.TypedEncoder.injections._. This will encode the data constructors as strings.
Known issue: An invalid injection instance will be derived if there are data constructors with the same name.
For example, consider the following sealed family:
sealed trait Foo
object A { case object Bar extends Foo }
object B { case object Bar extends Foo }

A.Bar and B.Bar will both be encoded as "Bar" thereby breaking the law that invert(apply(x)) == x.

Cats.html.body:
Using Cats with Frameless
There are two main parts to the cats integration offered by Frameless:

effect suspension in TypedDataset using cats-effect and cats-mtl
RDD enhancements using algebraic typeclasses in cats-kernel

All the examples below assume you have previously imported cats.implicits and frameless.cats.implicits.
Note that you should not import frameless.syntax._ together with frameless.cats.implicits._.
import cats.implicits._
import frameless.cats.implicits._

Effect Suspension in typed datasets
As noted in the section about Job, all operations on TypedDataset are lazy. The results of 
operations that would normally block on plain Spark APIs are wrapped in a type constructor F[_], 
for which there exists an instance of SparkDelay[F]. This typeclass represents the operation of 
delaying a computation and capturing an implicit SparkSession. 
In the cats module, we utilize the typeclasses from cats-effect for abstracting over these 
effect types - namely, we provide an implicit SparkDelay instance for all F[_] for which exists
an instance of cats.effect.Sync[F].
This allows one to run operations on TypedDataset in an existing monad stack. For example, given
this pre-existing monad stack:
import frameless.TypedDataset
import cats.data.ReaderT
import cats.effect.IO
import cats.effect.implicits._

type Action[T] = ReaderT[IO, SparkSession, T]

We will be able to request that values from TypedDataset will be suspended in this stack:
val typedDs = TypedDataset.create(Seq((1, "string"), (2, "another")))
// typedDs: TypedDataset[(Int, String)] = [_1: int, _2: string]
val result: Action[(Seq[(Int, String)], Long)] = for {
  sample 
As with Job, note that nothing has been run yet. The effect has been properly suspended. To
run our program, we must first supply the SparkSession to the ReaderT layer and then
run the IO effect:
result.run(spark).unsafeRunSync()
// res5: (Seq[(Int, String)], Long) = (WrappedArray((1, "string")), 2L)

Convenience methods for modifying Spark thread-local variables
The frameless.cats.implicits._ import also provides some syntax enrichments for any monad
stack that has the same capabilities as Action above. Namely, the ability to provide an
instance of SparkSession and the ability to suspend effects.
For these to work, we will need to import the implicit machinery from the cats-mtl library:
import cats.mtl.implicits._

And now, we can set the description for the computation being run:
val resultWithDescription: Action[(Seq[(Int, String)], Long)] = for {
  r 
Using algebraic typeclasses from Cats with RDDs
Data aggregation is one of the most important operations when working with Spark (and data in general).
For example, we often have to compute the min, max, avg, etc. from a set of columns grouped by
different predicates. This section shows how cats simplifies these tasks in Spark by
leveraging a large collection of Type Classes for ordering and aggregating data.
Cats offers ways to sort and aggregate tuples of arbitrary arity.
import frameless.cats.implicits._

val data: RDD[(Int, Int, Int)] = sc.makeRDD((1, 2, 3) :: (1, 5, 3) :: (8, 2, 3) :: Nil)
// data: RDD[(Int, Int, Int)] = ParallelCollectionRDD[12] at makeRDD at Cats.md:127

println(data.csum)
// (10,9,9)
println(data.cmax)
// (8,2,3)
println(data.cmin)
// (1,2,3)

In case the RDD is empty, the csum, cmax and cmin will use the default values for the type of
elements inside the RDD. There are counterpart operations to those that have an Option return type
to deal with the case of an empty RDD:
val data: RDD[(Int, Int, Int)] = sc.emptyRDD
// data: RDD[(Int, Int, Int)] = EmptyRDD[13] at emptyRDD at Cats.md:143

println(data.csum)
// (0,0,0)
println(data.csumOption)
// None
println(data.cmax)
// (0,0,0)
println(data.cmaxOption)
// None
println(data.cmin)
// (0,0,0)
println(data.cminOption)
// None

The following example aggregates all the elements with a common key.
type User = String
type TransactionCount = Int

val allData: RDD[(User,TransactionCount)] =
   sc.makeRDD(("Bob", 12) :: ("Joe", 1) :: ("Anna", 100) :: ("Bob", 20) :: ("Joe", 2) :: Nil)
// allData: RDD[(User, TransactionCount)] = ParallelCollectionRDD[14] at makeRDD at Cats.md:174

val totalPerUser =  allData.csumByKey
// totalPerUser: RDD[(User, TransactionCount)] = ShuffledRDD[15] at reduceByKey at implicits.scala:42

totalPerUser.collectAsMap
// res16: collection.Map[User, TransactionCount] = Map(
//   "Bob" -> 32,
//   "Joe" -> 3,
//   "Anna" -> 100
// )

The same example would work for more complex keys.
import scala.collection.immutable.SortedMap

val allDataComplexKeu =
   sc.makeRDD( ("Bob", SortedMap("task1" -> 10)) ::
    ("Joe", SortedMap("task1" -> 1, "task2" -> 3)) :: ("Bob", SortedMap("task1" -> 10, "task2" -> 1)) :: ("Joe", SortedMap("task3" -> 4)) :: Nil )
// allDataComplexKeu: RDD[(String, SortedMap[String, Int])] = ParallelCollectionRDD[16] at makeRDD at Cats.md:190

val overalTasksPerUser = allDataComplexKeu.csumByKey
// overalTasksPerUser: RDD[(String, SortedMap[String, Int])] = ShuffledRDD[17] at reduceByKey at implicits.scala:42

overalTasksPerUser.collectAsMap
// res17: collection.Map[String, SortedMap[String, Int]] = Map(
//   "Bob" -> Map("task1" -> 20, "task2" -> 1),
//   "Joe" -> Map("task1" -> 1, "task2" -> 3, "task3" -> 4)
// )

Joins
// Type aliases for meaningful types
type TimeSeries = Map[Int,Int]
type UserName = String

Example: Using the implicit full-our-join operator
import frameless.cats.outer._

val day1: RDD[(UserName,TimeSeries)] = sc.makeRDD( ("John", Map(0 -> 2, 1 -> 4)) :: ("Chris", Map(0 -> 1, 1 -> 2)) :: ("Sam", Map(0 -> 1)) :: Nil )
// day1: RDD[(UserName, TimeSeries)] = ParallelCollectionRDD[18] at makeRDD at Cats.md:215
val day2: RDD[(UserName,TimeSeries)] = sc.makeRDD( ("John", Map(0 -> 10, 1 -> 11)) :: ("Chris", Map(0 -> 1, 1 -> 2)) :: ("Joe", Map(0 -> 1, 1 -> 2)) :: Nil )
// day2: RDD[(UserName, TimeSeries)] = ParallelCollectionRDD[19] at makeRDD at Cats.md:218

val daysCombined = day1 |+| day2
// daysCombined: RDD[(UserName, TimeSeries)] = MapPartitionsRDD[23] at mapValues at implicits.scala:67

daysCombined.collect()
// res18: Array[(UserName, TimeSeries)] = Array(
//   ("Joe", Map(0 -> 1, 1 -> 2)),
//   ("Sam", Map(0 -> 1)),
//   ("Chris", Map(0 -> 2, 1 -> 4)),
//   ("John", Map(0 -> 12, 1 -> 15))
// )

Note how the user's timeseries from different days have been aggregated together.
The |+| (Semigroup) operator for key-value pair RDD will execute a full-outer-join
on the key and combine values using the default Semigroup for the value type.
In cats:
Map(1 -> 2, 2 -> 3) |+| Map(1 -> 4, 2 -> -1)
// res19: Map[Int, Int] = Map(1 -> 6, 2 -> 2)
